import React, { Component } from "react";
import {Apiurl} from '../../../services/apirest';
import axios from "axios";


class listarComuna extends Component{

    state={
        Comunas:[]
    }

    componentIDMount(){
        axios.get('http://localhost:4000/API/comuna')
        .then(Response =>{
            console.log(Response)
        })

    }

    render(){

        return(
            <React.Fragment>
                <div className="container">
                    <table class="table table-hover">
                    <thead>
                            <tr>
                            <th scope="col">#</th>
                            <th scope="col">First</th>
                            <th scope="col">Last</th>
                            <th scope="col">Handle</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                            <th scope="row">1</th>
                            <td>Mark</td>
                            <td>Otto</td>
                            <td>@mdo</td>
                            </tr>
                            <tr>
                            <th scope="row">2</th>
                            <td>Jacob</td>
                            <td>Thornton</td>
                            <td>@fat</td>
                            </tr>
                            <tr>
                            <th scope="row">3</th>
                            <td colspan="2">Larry the Bird</td>
                            <td>@twitter</td>
                            </tr>
                        </tbody>
                    </table>
                </div>


            </React.Fragment>
        );       

    }
}

export default listarComuna
